The FTC framework expects your code to be written in a certain way so that it can use it in its own classes. In particular, you need to have a class which is marked as "runnable" (either as autonomous or teleop) and is usable (inherits from the com.qualcomm.robotcore.eventloop.opmode.OpMode class). For example, a wrong way to write FTC code: import com.qualcomm.robotcore.eventloop.opmode.Autonomous;
import com.qualcomm.robotcore.hardware.Servo; @Autonomous(name = "FooOp")
public class FooOp { public static void main(String[] args) { Servo s = (Servo) hardwareMap.get("myServo"); int i = 0; while (true) { s.setPosition(i); i = (i + 10) % 180; } }
} There are a few things wrong with this. The hardwareMap does not even exist, so you can't control any hardware. The main method here will not be run at all -- Qualcomm has their own main code, so yours will not be run. The @Autonomous annotation is wrong -- this class is not an "Operation Mode", which is what the framework is expecting. This will probably result in some strange runtime error (TODO: Add a picture of that runtime error). Here is a correct implementation: import com.qualcomm.robotcore.eventloop.opmode.Autonomous;
import com.qualcomm.robotcore.eventloop.opmode.LinearOpMode;
import com.qualcomm.robotcore.hardware.Servo; @Autonomous(name = "FooOp")
public class FooOp extends LinearOpMode { @Override public void runOpMode() { Servo s = (Servo) hardwareMap.get("myServo"); int i = 0; waitForStart(); while (true) { s.setPosition(i); i = (i + 10) % 180; } }
} All the mentioned problems in the previous code have been corrected here: The hardwareMap now exists: It exists in the superclasses of FooOp. The @Autonomous annotation now makes sense: It is annotating a class which is a Linear Operation Mode. The Qualcomm framework can now correctly detect and run it.

