Start with a Robot Config like so: MyRobotCfg.java import com.qualcomm.robotcore.hardware.HardwareMap;
import ftc.evlib.hardware.config.RobotCfg; public class MyRobotCfg extends RobotCfg { public MyRobotCfg(HardwareMap hardwareMap) { super(hardwareMap); } @Override public void start() {} @Override public void act() {} @Override public void stop() {}
} Right now, this config represents an empty bot. It has one brain, one phone, and that's it. This is already pretty powerful – without any custom logic, you have direct access to all the phone's sensors. This is sufficient for an abstract example, but what if we want to add motors to a bot? Let's start by adding a simple DC motor to a bot, which on the robot core has been programmed to be called "bruh": public class MyRobotCfg extends RobotCfg { public final DcMotor myMotor; public MyRobotCfg(HardwareMap hardwareMap) { super(hardwareMap); myMotor = hardwareMap.get(DcMotorEx.class, "bruh"); }
} Some code is not shown for conciseness. This also works with the getter pattern, like so: public class MyRobotCfg extends RobotCfg { private final DcMotor myMotor; public DcMotor getMyMotor() { return myMotor; } public MyRobotCfg(HardwareMap hardwareMap) { super(hardwareMap); myMotor = hardwareMap.get(DcMotorEx.class, "bruh"); }
} Now, when the software team needs the motor, and has a MyRobotCfg, they can call myRobotCfg.getMyMotor() to receive and move the motor. The complete code should look like this: import com.qualcomm.robotcore.hardware.DcMotor;
import com.qualcomm.robotcore.hardware.DcMotorEx;
import com.qualcomm.robotcore.hardware.HardwareMap;
import ftc.evlib.hardware.config.RobotCfg; public class MyRobotCfg extends RobotCfg { private final DcMotor myMotor; public DcMotor getMyMotor() { return myMotor; } public MyRobotCfg(HardwareMap hardwareMap) { super(hardwareMap); myMotor = hardwareMap.get(DcMotorEx.class, "bruh"); } @Override public void start() {} @Override public void act() {} @Override public void stop() {}
} This is all the code you need to move to the next step. If there are some other types of hardware you'd like to add, find them in the FTC javadoc , or see some more types we've made in the Hardware section .

