EVStates | EVEndConditions | EVStateMachineBuilder EVStates is a factory class that extends States from the state-machine-framework. It inherits all the factory methods from States, and adds its own that relate to FTC. Some that we use frequently are: mecanumDrive -- drives with the mecanum wheels and stabilizes with the gyro servoTurn -- turns a servo to a preset at a given speed calibrateGyro -- waits for the gyro sensor to finish calibrating Some others that are also useful are: drive -- drives with a TwoMotors object turn -- tuns with a TwoMotors object oneWheelTurn -- powers one wheel to turn motorTurn -- turns a motor This example uses guava to initialize lists, which we have left for alternative methods. ftc/evlib/statemachine/EVStates.java package ftc.evlib.statemachine; import com.google.common.collect.ImmutableList;
