ure(StateName stateName, final StateName unknownUnknownState, final StateName unknownRedState, final StateName unknownBlueState, final StateName redUnknownState, final StateName redRedState, final StateName redBlueState, final StateName blueUnknownState, final StateName blueRedState, final StateName blueBlueState ) { return new BasicAbstractState(stateName) { @Override public void init() { frameGrabber.setImageProcessor(new RGBBeaconProcessor()); frameGrabber.grabSingleFrame(); } @Override public boolean isDone() { return frameGrabber.isResultReady(); } @Override public StateName getNextStateName() { BeaconColorResult beaconColorResult = (BeaconColorResult) frameGrabber.getResult().getResult(); BeaconColorResult.BeaconColor leftColor = beaconColorResult.getLeftColor(); BeaconColorResult.BeaconColor rightColor = beaconColorResult.getRightColor(); if (leftColor == BeaconColorResult.BeaconColor.RED) { if (rightColor == BeaconColorResult.BeaconColor.RED) { return redRedState; } else if (rightColor == BeaconColorResult.BeaconColor.BLUE) { return redBlueState; } else { return redUnknownState; } } else if (leftColor == BeaconColorResult.BeaconColor.BLUE) { if (rightColor == BeaconColorResult.BeaconColor.RED) { return blueRedState; } else if (rightColor == BeaconColorResult.BeaconColor.BLUE) { return blueBlueState; } else { return blueUnknownState; } } else { if (rightColor == BeaconColorResult.BeaconColor.RED) { return unknownRedState; } else if (rightColor == BeaconColorResult.BeaconColor.BLUE) { return unknownBlueState; } else { return unknownUnknownState; } } } }; } /** * @param stateName the name of the state * @param nMotors the motors to turn off * @return the created State */ public static State stop(StateName stateName, final NMotors nMotors) { return new BasicAbstractState(stateName) { @Override public void init() { nMotors.stop(); } @Override public boolean isDone() { return false; } @Override public StateName getNextStateName() { return null; } }; } /** * @param