n nextStateName; } }; } /** * drive using the mecanum wheels * travels for a certain amount of time defined by the robots speed and a desired distance * * @param stateName the name of the state * @param nextStateName the next state to go to * @param distance the distance to travel * @param mecanumControl the mecanum wheels * @param gyro the gyro sensor * @param velocity the velocity to drive at * @param direction the direction to drive * @param orientation the angle to rotate to * @param maxAngularSpeed the max speed to rotate to that angle * @return the created State * @see MecanumControl * @see GyroSensor * @see Distance */ public static State mecanumDrive(StateName stateName, final StateName nextStateName, Distance distance, final MecanumControl mecanumControl, final GyroSensor gyro, final double velocity, final Angle direction, final Angle orientation, final Angle tolerance, final double maxAngularSpeed) { mecanumControl.setDriveMode(MecanumMotors.MecanumDriveMode.NORMALIZED); double speedMetersPerMillisecond = mecanumControl.getMaxRobotSpeed().metersPerMillisecond() * velocity; final double durationMillis = Math.abs(distance.meters() / speedMetersPerMillisecond); final EndCondition gyroEC = EVEndConditions.gyroCloseTo(gyro, orientation, tolerance); return new BasicAbstractState(stateName) { long startTime = 0; @Override public void init() { mecanumControl.setControl( TranslationControls.constant(velocity, direction), RotationControls.gyro(gyro, orientation, maxAngularSpeed) ); startTime = System.currentTimeMillis(); } @Override public boolean isDone() { long now = System.currentTimeMillis(); long elapsedTime = now - startTime; if (elapsedTime >= durationMillis) { mecanumControl.setTranslationControl(TranslationControls.ZERO); return gyroEC.isDone(); } return false; } @Override public StateName getNextStateName() { mecanumControl.stop(); return nextStateName; } }; } /** * drive using the mecanum wheels * * @param stateName the name of the state * @param transiti