tStateName ) ), twoMotors, velocity); } /** * Turn for a certain angle by calculating the time required for that angle * * @param stateName the name of the state * @param nextStateName the state to go to when done turning * @param angle the angle to turn * @param minRobotTurnTime the time it takes for the robot to turn * @param twoMotors the motors to run * @param velocity the velocity to turn (negative for turning left) * @return the created State * @see TwoMotors */ public static State turn(StateName stateName, StateName nextStateName, Angle angle, Time minRobotTurnTime, TwoMotors twoMotors, double velocity) { double speedRotationsPerMillisecond = velocity / minRobotTurnTime.milliseconds(); double durationMillis = Math.abs(angle.degrees() / 360 / speedRotationsPerMillisecond); return turn(stateName, ImmutableList.of( new Transition( EndConditions.timed((long) durationMillis), nextStateName ) ), twoMotors, velocity); } /** * Turn for a certain angle using a gyro sensor * * @param stateName the name of the state * @param nextStateName the state to go to when done turning * @param angle the angle to turn * @param gyro the gyro sensor to use * @param twoMotors the motors to turn * @param velocity the velocity to turn at (negative to turn left) * @return the created State * @see TwoMotors */ public static State turn(StateName stateName, StateName nextStateName, Angle angle, GyroSensor gyro, TwoMotors twoMotors, double velocity) { return turn(stateName, ImmutableList.of( new Transition( EVEndConditions.gyroCloseToRelative(gyro, angle, Angle.fromDegrees(5)), nextStateName ) ), twoMotors, velocity); } /** * Turn with one wheel for a certain angle by calculating the time needed to turn that angle * * @param stateName the name of the state * @param nextStateName the state to go to when done turning * @param angle the angle to turn * @param minRobotTurnTime the time it takes for the robot to turn * @param twoMotors the motors to turn * @param isRightWheel tells which wheel t