 { return new AbstractState(transitions) { @Override public void init() { } @Override public void run() { } @Override public void dispose() { } }; } /** * "Stop! The cup is full!" said Tokusan. * * "Exactly," said Master Ryutan. "You are like this cup; you are full of * ideas. You come and ask for teaching, but your cup is full; I can't put * anything in. Before I can teach you, you'll have to empty your cup." * * An empty state. * * @param nextStateName the next state to be run * @return the created State */ public static State empty(final StateName nextStateName) { return new BasicAbstractState() { @Override public void init() { } @Override public boolean isDone() { return true; } @Override public StateName getNextStateName() { return nextStateName; } }; } /** * "She set up a great loom in her palace, and set to weaving a web of * threads long and fine. Then she said to us: 'Young men, my suitors * now that the great Odysseus has perished, wait, though you are eager * to marry me, until I finish this web, so that my weaving will not be * useless and wasted.'" * ~Penelope, the Odyssey * * A state used to run a thread. Useful for off-loading computer intensive * tasks such as image processing. * * @param nextStateName the next state to be run immediately * @param thread the thread to be run at the start of the state * @return the created State */ public static State runThread(final StateName nextStateName, final Thread thread) { return new BasicAbstractState() { @Override public void init() { thread.start(); } @Override public boolean isDone() { return true; } @Override public StateName getNextStateName() { return nextStateName; } }; } /** * "The power of the Executive Branch is vested in the President of the * United States, who also acts as head of state and Commander-in-Chief of * the armed forces." * * This is used to do branching and decision trees in the state machine * can be used for doing different things depending on which side of the * field you are on * 