icate between threads * * @param trueStateName the state to go to if the receiver returns true * @param falseStateName the state to go to if the receiver returns false * @param nullStateName the state to go to if the receiver returns null * @param receiver the receiver that decides which branch to go to * @return the created State */ public static State branch(final StateName trueStateName, final StateName falseStateName, final StateName nullStateName, final ResultReceiver<Boolean> receiver) { return new BasicAbstractState() { @Override public void init() { } @Override public boolean isDone() { return receiver.isReady(); } @Override public StateName getNextStateName() { if (receiver.getValue() == null) { return nullStateName; } else if (receiver.getValue()) { return trueStateName; } else { return falseStateName; } } }; } /** * Count von Count: Five bananas. Six bananas. SEVEN BANANAS! * [thunder strikes] * Count von Count: Ah, ah, ah. Now, that was silly. Wouldn't you agree, my * bats? Ah, ah, ah. * * Moves to continueStateName for the first n times it is called, then moves * to doneStateName after that * * @param continueStateName will be transitioned to first * @param doneStateName will be transitioned to after * @param n the number of times to return continueStateName * @return the created State */ public static State count(final StateName continueStateName, final StateName doneStateName, final int n) { return new BasicAbstractState() { int i = 0; @Override public void init() { i++; } @Override public boolean isDone() { return true; } @Override public StateName getNextStateName() { return i <= n ? continueStateName : doneStateName; } }; }
