ion */ public static EndCondition valueGreater(final InputExtractor<Double> inputExtractor, final double target, final boolean inclusive) { return new EndCondition() { @Override public void init() { } @Override public boolean isDone() { if (inclusive) { return inputExtractor.getValue() >= target; } else { return inputExtractor.getValue() > target; } } }; } /** * @param inputExtractor the input extractor * @param target the target value * @param inclusive whether or not the values being equal satisfies the * condition * @return the created EndCondition */ public static EndCondition valueLess(final InputExtractor<Double> inputExtractor, final double target, final boolean inclusive) { return new EndCondition() { @Override public void init() { } @Override public boolean isDone() { if (inclusive) { return inputExtractor.getValue() <= target; } else { return inputExtractor.getValue() < target; } } }; } /** * @param inputExtractor the input extractor * @param min the lower edge of the target range * @param max the upper edge of the target range * @param inclusive whether or not the value being equal to the min or max * satisfies the condition * when min = max, this should be true. * @return the created EndCondition */ public static EndCondition valueBetween(final InputExtractor<Double> inputExtractor, final double min, final double max, final boolean inclusive) { return new EndCondition() { @Override public void init() { } @Override public boolean isDone() { double value = inputExtractor.getValue(); if (inclusive) { return min <= value && value <= max; } else { return min < value && value < max; } } }; } /** * @param inputExtractor the input extractor * @param target the target value * @param tolerance the tolerance +/- the value to be accepted as meeting * the condition * @param inclusive whether or not the value being on the edge of the * tolerance satisfies the condition. * when the tolerance is 0, this should be true. * @return the created EndCondition */ public static