StateMachineBuilder is responsible for setting up the linkage between the states. It stores a map of the names of the states and the state itself. It also includes convenience methods to easily add pre-defined States to the state machine, reducing the complexity of adding states. When all the states are done being added, the build method is called, which returns a StateMachine object. ftc/electronvolts/statemachine/StateMachineBuilder.java package ftc.electronvolts.statemachine; import java.util.HashMap;
import java.util.Map; import ftc.electronvolts.util.MatchTimer;
