import ftc.electronvolts.util.units.Time; /** * This file was made by the electronVolts, FTC team 7393 * * The state machine builder simplifies the creation of the state machine. The * builder requires an enum with values for each state. See the wiki for an * example of how to use it. * * To write your own StateMachine builder, make a class that extends this one * and add your own convenience methods such as addDrive or addServoTurn. It * will inherit all these methods as well, so that when you use your class, you * will have access to all these methods and your own in one place. */
