which branch to go to */ public void addBranch(StateName stateName, StateName trueStateName, StateName falseStateName, boolean condition) { add(stateName, States.branch(trueStateName, falseStateName, condition)); } /** * @param stateName the enum value to be associated with the wait state * @param trueStateName the state to go to if the condition is true * @param falseStateName the state to go to if the condition is false * @param nullStateName the state to go to if the condition is null * @param condition the boolean to decide which branch to go to */ public void addBranch(StateName stateName, StateName trueStateName, StateName falseStateName, StateName nullStateName, Boolean condition) { add(stateName, States.branch(trueStateName, falseStateName, nullStateName, condition)); } /** * @param stateName the enum value to be associated with the wait state * @param trueStateName the state to go to if the receiver returns true * @param falseStateName the state to go to if the receiver returns false * @param nullStateName the state to go to if the receiver returns null * @param receiver the receiver that decides which branch to go to */ public void addBranch(StateName stateName, StateName trueStateName, StateName falseStateName, StateName nullStateName, ResultReceiver<Boolean> receiver) { add(stateName, States.branch(trueStateName, falseStateName, nullStateName, receiver)); } /** * Adds an empty state that does nothing and moves to the next state * * @param stateName the name of the state * @param nextStateName the name of the state to go to next */ public void addEmpty(StateName stateName, StateName nextStateName) { add(stateName, States.empty(nextStateName)); } public void addEmpty(StateName stateName, Map<StateName, EndCondition> transitions) { add(stateName, States.empty(transitions)); } /** * Adds a stop state to the stateMap * * @param stateName name of the stop state */ public void addStop(StateName stateName) { add(stateName, States.stop()); } /** * A state used to