Before you read this, it is helpful to read about the Motor and MotorEnc interfaces and also how to create motors . The following class groups any number of motors and can run them all at once with a list of powers. ftc/evlib/hardware/motors/NMotors.java package ftc.evlib.hardware.motors; import java.util.ArrayList;
import java.util.Collections;
import java.util.List; import ftc.electronvolts.util.Utility;
import ftc.electronvolts.util.units.Velocity; /** * This file was made by the electronVolts, FTC team 7393 * Date Created: 9/12/16 * * A general controller for a collection of N motors. * Knows how to run the motors given a list of Doubles. * Can normalize the powers/speeds before running if requested. * Subclasses can have fixed numbers of motors * * @see Motor * @see MotorEnc * @see OneMotors * @see TwoMotors * @see ThreeMotors * @see FourMotors * @see FiveMotors * @see SixMotors */
public class NMotors { /** * the list of motors that are grouped */ private final List<? extends Motor> motors; /** * whether or not to use speed mode on the motors */ private final boolean useSpeedMode; /** * the measured maximum speed of the robot */ private final Velocity maxRobotSpeed; /** * the values most recently sent to the motors */ private final double[] values; private final int[] encoders; /** * @param motors the list of motors * @param useSpeedMode true if encoder-regulated speed mode is desired * @param maxRobotSpeed the measured maximum speed of the robot */ public NMotors(List<? extends Motor> motors, boolean useSpeedMode, Velocity maxRobotSpeed) { //if using speed mode, the motors need to have encoders if (useSpeedMode) { for (int i = 0; i < motors.size(); i++) { if (!(motors.get(i) instanceof MotorEnc)) { throw new IllegalArgumentException("Argument 'motors' must be of type List<MotorEnc> if speed mode is to be used."); } } } this.motors = motors; this.useSpeedMode = useSpeedMode; this.maxRobotSpeed = maxRobotSpeed.abs(); values = new double[motors.size()]; encoders = new int[motors.size()]; } /** * @return the measured maximum speed of the robot */ public Velocity getMaxRobotSpeed() { return maxRobotSpeed; } /** * Allows different stop behaviors for different operations * * @param stopBehavior what to do when the power/speed is 0 */ /** * scale all the motor values if any one power is above the maximum of 1 * * @param values the powers/speeds to be scaled and then run */ public void runNormalized(List<Double> values) { if (values.size() != motors.size()) { throw new IllegalArgumentException("Argument 'values' must have the same length as the number of motors."); } //if the inputs are too high, scale them double highest = 0; //find the magnitude of the number with the highest magnitude for (double n : values) { if (Math.abs(n) > highest) { highest = Math.abs(n); } } if (highest < 1) { //only normalize if the values are too high highest = 1; } //rescale the values by the highest value List<Double> valuesScaled = new ArrayList<>(); for (double power : values) { valuesScaled.add(power / highest); } run(valuesScaled); } /** * run the motors with raw power/speed * * @param values the raw values to send to the motors */ public void run(List<Double> values) { if (values.size() != motors.size()) { throw new IllegalArgumentException("Argument 'values' must have the same length as the number of motors."); } //set the motor powers/speeds of each motor for (int i = 0; i < motors.size(); i++) { Double value = Utility.motorLimit(values.get(i)); if (useSpeedMode) { MotorEnc motorEnc = ((MotorEnc) motors.get(i)); motorEnc.setSpeed(value); encoders[i] = motorEnc.getEncoderPosition(); } else { motors.get(i).setPower(value); } this.values[i] = value; } } /** * @param i the index of the motor to read the value from * @return the values most recently sent to the motors */ public double getValue(int i) { return values[i]; } /** * @param i the index of the motor to read the encoder value from * @return the values of the motor encoders. All encoder values will be 0 if useSpeedMode is false */ public int getEncoder(int i) { return encoders[i]; } /** * stop all the motors */ public void stop() { //create a list of the same length as motors filled with zeroes run(new ArrayList<>(Collections.nCopies(motors.size(), 0.0))); } /** * Send the motor commands to the motor controller */ public void update() { for (int i = 0; i < motors.size(); i++) { motors.get(i).update(); } }
} There are also similar classes for every other number of motors up to 6. (for example: FourMotors ). If you need more than 6 motors, you can extend the class yourself. (You never know when you might need 800 motors for some reason.)

