es the robot's translation (x and y) */ public void setTranslationControl(TranslationControl translationControl) { this.translationControl = translationControl; } /** * set both translation and rotation controls at once * * @param translationControl the controller that determines the robot's translation (x and y) * @param rotationControl the controller that determines the robot's rotation */ public void setControl(TranslationControl translationControl, RotationControl rotationControl) { this.translationControl = translationControl; this.rotationControl = rotationControl; } /** * set both translation and rotation controls at once * * @param rotationControl the controller that determines the robot's rotation * @param translationControl the controller that determines the robot's translation (x and y) */ public void setControl(RotationControl rotationControl, TranslationControl translationControl) { this.translationControl = translationControl; this.rotationControl = rotationControl; } /** * Set both translation and rotation controls to the same object * * @param xyrControl the controller that determines both the translation and rotation */ public void setControl(XYRControl xyrControl) { this.translationControl = xyrControl; this.rotationControl = xyrControl; } /** * stop the motors */ public void stop() { translationControl = TranslationControls.ZERO; rotationControl = RotationControls.ZERO; mecanumMotors.stop(); } /** * set the drive mode to turn on or off translation normalizing * * @param mode the drive mode */ public void setDriveMode(MecanumMotors.MecanumDriveMode mode) { mecanumMotors.setDriveMode(mode); } /** * update the motor powers based on the output of the translationControl and rotationControl */ public void act() { translationWorked = translationControl.act(); //in case the same object is passed in that implements both controllers if (translationControl == rotationControl) { rotationWorked = translationWorked; } else { rotationWorked = rotationControl.act