ic int hashCode() { final int prime = 31; int result = 1; long temp; temp = Double.doubleToLongBits(radians); result = prime * result + (int) (temp ^ (temp >>> 32)); return result; } @Override public boolean equals(Object obj) { if (this == obj) return true; if (obj == null) return false; if (getClass() != obj.getClass()) return false; Angle other = (Angle) obj; if (Double.doubleToLongBits(radians) != Double.doubleToLongBits(other.radians)) return false; return true; } /** * Creates an Angle class from a value in radians * * @param v the value in radians * @return the Angle class */ public static Angle fromRadians(double v) { return new Angle(v); } /** * Creates an Angle class from a value in degrees * * @param v the value in degrees * @return the Angle class */ public static Angle fromDegrees(double v) { return new Angle(v * RAD_PER_DEG); } /** * Creates an Angle class from a value in rotations * * @param v the value in rotations * @return the Angle class */ public static Angle fromRotations(double v) { return new Angle(v * RAD_PER_ROT); } /** * * @return the value of the Angle in radians */ public double radians() { return radians; } /** * * @return the value of the Angle in degrees */ public double degrees() { return radians * DEG_PER_RAD; } /** * * @return the value of the Angle in rotations */ public double rotations() { return radians * ROT_PER_RAD; }
