public class InputExtractors { private static final InputExtractor<Double> ZERO = constant(0.0); /** * @return an InputExtractor<Double> that always returns 0 */ public static InputExtractor<Double> zero() { return ZERO; } /** * @param value the value to return * @return an InputExtractor that always returns the specified value */ public static <T> InputExtractor<T> constant(final T value) { return new InputExtractor<T>() { @Override public T getValue() { return value; } }; } /** * Multiply an InputExtractor<Double> by a constant * * @param inputExtractor the InputExtractor<Double> to multiply * @param value the constant to multiply by * @return the created InputExtractor<Double> */ public static InputExtractor<Double> multiply(final InputExtractor<Double> inputExtractor, final double value) { return new InputExtractor<Double>() { @Override public Double getValue() { return inputExtractor.getValue() * value; } }; } /** * Multiply an InputExtractor<Double> by a constant * * @param value the constant to multiply by * @param inputExtractor the InputExtractor<Double> to multiply * @return the created InputExtractor<Double> */ public static InputExtractor<Double> multiply(final double value, final InputExtractor<Double> inputExtractor) { return multiply(value, inputExtractor); } /** * Multiply an InputExtractor<Double> by another InputExtractor<Double> * * @param inputExtractor1 the first InputExtractor<Double> * @param inputExtractor2 the second InputExtractor<Double> * @return the created InputExtractor<Double> */ public static InputExtractor<Double> multiply(final InputExtractor<Double> inputExtractor1, final InputExtractor<Double> inputExtractor2) { return new InputExtractor<Double>() { @Override public Double getValue() { return inputExtractor1.getValue() * inputExtractor2.getValue(); } }; } /** * Divide an InputExtractor<Double> by a constant. Equivalent to multiplying * by the reciprocal of the constant * * @param inputExtractor the InputExtractor<Double> * @param