The idea of servo presets is to replace "magic numbers" (numbers whose purpose is not obvious) with named servo positions. For example, instead of 7.341, you can write ArmServoPresets.LEFT -- much more readable. Another feature of the servo presets is that you can modify the preset values without changing the app and re-uploading to the phone. The way these two features are implemented is that each servo has an enum of presets: /** * all the possible values for the arm servo */ public enum ArmServoPresets { LEFT, MIDDLE, RIGHT } and each RobotCfg has a list of servos, each of which has a hardware name (such as "armServo") and a list of presets determined from the enum (such as ArmServoPresets.values()): /** * defines all the servos on the robot */ public enum SampleServoName implements ServoName { //enum name("hardware name", preset enum.values()), ARM_SERVO("armServo", ArmServoPresets.values()), LEG_SERVO("legServo", LegServoPresets.values()); private final String hardwareName; private final Enum[] presets; SampleServoName(String hardwareName, Enum[] presets) { this.hardwareName = hardwareName; this.presets = presets; } @Override public String getHardwareName() { return hardwareName; } @Override public Enum[] getPresets() { return presets; } @Override public Class<? extends RobotCfg> getRobotCfg() { return SampleRobotCfg.class; } } To actually enter the preset values, you need to make and run a ServoTuneOp: /sample/v3/SampleServoTuneOp.java package org.firstinspires.ftc.teamcode.sample.v3; import com.qualcomm.robotcore.eventloop.opmode.TeleOp; import ftc.evlib.hardware.config.RobotCfg;
