import ftc.evlib.hardware.servos.ServoName;
import ftc.evlib.statemachine.EVStates; /** * This file was made by the electronVolts, FTC team 7393 * Date Created: 10/18/16 * * A sample extension of the StateMachineBuilder. * This subclass adds convenience methods for any opmodes that use the SampleRobotConfig. */ public class SampleStateMachineBuilder extends StateMachineBuilder { /** * The SampleRobotCfg to get the drive motors from */ private final SampleRobotCfg sampleRobotCfg; /** * Create a SampleStateMachineBuilder, passing it the SampleRobotCfg * The SampleRobotCfg's drive motors will be passed to the drive state every time * * @param firstStateName the state to start with * @param sampleRobotCfg the robot's configuration */ public SampleStateMachineBuilder(StateName firstStateName, SampleRobotCfg sampleRobotCfg) { super(firstStateName); this.sampleRobotCfg = sampleRobotCfg; } /** * convenience method for adding a drive state * * @param stateName the name of the state * @param nextStateName the name of the state to go to after the drive is complete * @param distance the distance to drive * @param velocity the velocity to drive at */ public void addDrive(StateName stateName, StateName nextStateName, Distance distance, double velocity) { //add the drive state with the motors and speed from sampleRobotCfg add(EVStates.drive(stateName, nextStateName, distance, SampleRobotCfg.MAX_SPEED, sampleRobotCfg.getTwoMotors(), velocity)); } /** * add a servo init state that sets all the servos to their starting positions * * @param stateName the name of the state * @param nextStateName the state to go to after the servos are initialized */ public void addServoInit(StateName stateName, StateName nextStateName) { add(EVStates.servoInit(stateName, nextStateName, sampleRobotCfg.getServos())); } /** * turn a servo to a preset * * @param stateName the name of the state * @param nextStateName the state to go to after the servo is done turning * @param servoName the name of the servo as defined in SampleRobotCfg.ServoName * @param servoPreset the servo preset defined in SampleRobotCfg.ArmServoPresets and SampleRobotCfg.LegServoPresets * @param speed the speed to run the servo at * @param waitForDone wether or not to wait for the servo to turn to move to the next state */ public void addServo(StateName stateName, StateName nextStateName, ServoName servoName, Enum servoPreset, double speed, boolean waitForDone) { //get the servo ServoControl servoControl = sampleRobotCfg.getServo(servoName); //add the state that will run the command add(EVStates.servoTurn(stateName, nextStateName, servoControl, servoPreset, speed, waitForDone)); } /** * turn a servo to a preset at max speed * * @param stateName the name of the state * @param nextStateName the state to go to after the servo is done turning * @param servoName the name of the servo as defined in SampleRobotCfg.ServoName * @param servoPreset the servo preset defined in SampleRobotCfg.ArmServoPresets and SampleRobotCfg.LegServoPresets * @param waitForDone wether or not to wait for the servo to turn to move to the next state */ public void addServo(StateName stateName, StateName nextStateName, ServoName servoName, Enum servoPreset, boolean waitForDone) { //get the servo ServoControl servoControl = sampleRobotCfg.getServo(servoName); //add the state that will run the command add(EVStates.servoTurn(stateName, nextStateName, servoControl, servoPreset, waitForDone)); } } Then comes the easy part -- adding the servo init and turn states to the autonomous: /sample/v3/SampleAuto.java package org.firstinspires.ftc.teamcode.sample.v3; import com.qualcomm.robotcore.eventloop.opmode.Autonomous; import ftc.electronvolts.statemachine.StateMachine;
import ftc.electronvolts.statemachine.StateName;
import ftc.electronvolts.util.units.Distance;
import ftc.evlib.opmodes.AbstractAutoOp; /** * This file was made by the electronVolts, FTC team 7393 * Date Created: 10/18/16 * * A sample autonomous that: * 1. Initializes the servos * 2. Drives forward 2 feet * 3. Turns a servo arm */ @Autonomous(name="SampleAuto V3")
public class SampleAuto extends AbstractAutoOp<SampleRobotCfg> { /** * defines all the possible states for the state machine * modify this to have whatever states you want */ private enum S implements StateName { SERVO_INIT, DRIVE, SERVO_ARM, STOP } @Override public StateMachine buildStates() { //create a new builder for the states, starting with the SERVO_INIT state //we are using the custom builder and passing it the robotCfg SampleStateMachineBuilder b = new SampleStateMachineBuilder(S.SERVO_INIT, robotCfg); //add the servo initialization state b.addServoInit(S.SERVO_INIT, S.DRIVE); //define the DRIVE state to drive for 2 feet and move to the STOP state b.addDrive(S.DRIVE, S.SERVO_ARM, Distance.fromFeet(2), 0.5); //add the servo turn state b.addServo(S.SERVO_ARM, S.STOP, SampleRobotCfg.SampleServoName.ARM_SERVO, SampleRobotCfg.ArmServoPresets.RIGHT, true); //define the STOP state to be empty (and never exit) so the state machine will stop b.addStop(S.STOP); //build and return the StateMachine return b.build(); } @Override protected SampleRobotCfg createRobotCfg() { return new SampleRobotCfg(hardwareMap); } @Override protected void setup_act() { } @Override protected void go() { } @Override protected void act() { } @Override protected void end() { }
} The next step in the tutorial is Vuforia and OpenCV Beacon Color Detection .

95.body:
Vuforia and OpenCV are image processing libraries. Vuforia is by PTC and is built in to the latest version of the FTC app. It has high-level functions for tracking objects and augmented reality. It is very useful for finding the position of the beacon target images. OpenCV is an open source library that is more low-level, and because of this it is possible to write the procedures yourself and optimize them for better performance. Before you can use this example, you have to: Set up OpenCV. A guide is available on our website at http://www.gearbox4h.org/opencv/ (no longer exists) Create a Vuforia developer account and get a license key from https://developer.vuforia.com/license-manager This example uses EVLib functionality to: Initialize Vuforia Find the "Gears" beacon target image (this is controlled by the TeamColor.RED input) Crop the beacon out of the frame based on the target image location Find the beacon's color This example uses guava to initialize lists, which we have left for alternative methods. sample/v3/SampleVuforiaOp.java package org.firstinspires.ftc.teamcode.sample.v3; import com.google.common.collect.ImmutableList;
import com.qualcomm.robotcore.eventloop.opmode.Autonomous; import org.firstinspires.ftc.teamcode.R; import ftc.electronvolts.statemachine.EndConditions;
import ftc.electronvolts.statemachine.StateMachine;
import ftc.electronvolts.statemachine.StateMachineBuilder;
import ftc.electronvolts.statemachine.StateName;
import ftc.electronvolts.util.BasicResultReceiver;
import ftc.electronvolts.util.InputExtractor;
import ftc.electronvolts.util.ResultReceiver;
import ftc.electronvolts.util.TeamColor;
import ftc.electronvolts.util.files.Logger;
import ftc.electronvolts.util.units.Time;
import ftc.evlib.driverstation.Telem;
import ftc.evlib.hardware.config.RobotCfg;
import ftc.evlib.opmodes.AbstractAutoOp;
import ftc.evlib.statemachine.EVStates;
import ftc.evlib.vision.framegrabber.VuforiaFrameFeeder;
import ftc.evlib.vision.processors.BeaconColorResult; /** * This file was made by the electronVolts, FTC team 7393 * Date Created: 12/15/16 */
@Autonomous(name = "SampleVuforiaOp V3")
public class SampleVuforiaOp extends AbstractAutoOp<RobotCfg> { //get a key (for free) and paste it below by creating an account at https://developer.vuforia.com/license-manager private static final String LICENSE_KEY = ""; private static final int FRAME_SIZE = 16;
// private static final int FRAME_SIZE = 8;
// private static final int FRAME_SIZE = 64; private static final int FRAME_WIDTH = 3 * FRAME_SIZE; private static final int FRAME_HEIGHT = 4 * FRAME_SIZE;
// private static final int FRAME_WIDTH = 11 * FRAME_SIZE;
// private static final int FRAME_HEIGHT = 9 * FRAME_SIZE; private enum S implements StateName { WAIT_FOR_VUFORIA_INIT, FIND_BEACON_COLOR, DISPLAY, UNKNOWN_BEACON_COLOR, BEACON_COLOR_TIMEOUT } private ResultReceiver<VuforiaFrameFeeder> vuforiaReceiver; private ResultReceiver<BeaconColorResult> beaconColorResult; @Override public StateMachine buildStates() { vuforiaReceiver = VuforiaFrameFeeder.initInNewThread(LICENSE_KEY, R.id.cameraMonitorViewId, FRAME_WIDTH, FRAME_HEIGHT); StateMachineBuilder b = new StateMachineBuilder(S.WAIT_FOR_VUFORIA_INIT); beaconColorResult = new BasicResultReceiver<>(); b.addEmpty(S.WAIT_FOR_VUFORIA_INIT, b.ts(EndConditions.receiverReady(vuforiaReceiver), S.FIND_BEACON_COLOR)); b.add(EVStates.findBeaconColorState(S.FIND_BEACON_COLOR, S.DISPLAY, S.UNKNOWN_BEACON_COLOR, S.BEACON_COLOR_TIMEOUT, Time.fromSeconds(10), vuforiaReceiver, beaconColorResult, TeamColor.RED, 4, true)); b.add(EVStates.displayBeaconColorResult(S.DISPLAY, beaconColorResult)); b.add(EVStates.displayBeaconColorResult(S.UNKNOWN_BEACON_COLOR, beaconColorResult)); b.add(EVStates.displayBeaconColorResult(S.BEACON_COLOR_TIMEOUT, beaconColorResult)); return b.build(); } @Override protected RobotCfg createRobotCfg() { return new RobotCfg(hardwareMap) { @Override public void act() { } @Override public void stop() { } }; } @Override protected Logger createLogger() { //it will save logs in /FTC/logs/vuforiaOp[....].csv on the robot controller phone return new Logger("vuforiaOp", ".csv", ImmutableList.of( //each one of these is a column in the log file new Logger.Column("state", new InputExtractor<StateName>() { @Override public StateName getValue() { return stateMachine.getCurrentStateName(); } }), new Logger.Column("beaconColor", new InputExtractor<BeaconColorResult>() { @Override public BeaconColorResult getValue() { return beaconColorResult.getValue(); } }) )); } @Override protected void setup_act() { Telem.displayVuforiaReadiness(vuforiaReceiver); } @Override protected void go() { } @Override protected void act() { telemetry.addData("state", stateMachine.getCurrentStateName()); Telem.displayVuforiaReadiness(vuforiaReceiver); } @Override protected void end() { }
} This concludes the tutorial for now. Check back later for more updates and sample code, or go on to the Features page for an index of other things you can do with EVLib.
